import{_ as e,o as r,c as a,g as l}from"./app.dc9e9dff.js";const i="/uperf.jpg";const f=JSON.parse('{"title":"概述","description":"","frontmatter":{},"headers":[{"level":2,"title":"CPU Controller","slug":"cpu-controller","link":"#cpu-controller","children":[]},{"level":2,"title":"Thread Scheduler","slug":"thread-scheduler","link":"#thread-scheduler","children":[]},{"level":2,"title":"GPU Controller","slug":"gpu-controller","link":"#gpu-controller","children":[]},{"level":2,"title":"Voltage Optimization","slug":"voltage-optimization","link":"#voltage-optimization","children":[]},{"level":2,"title":"判断是否生效","slug":"判断是否生效","link":"#判断是否生效","children":[]},{"level":2,"title":"为什么我的监测数据表示调度未生效","slug":"为什么我的监测数据表示调度未生效","link":"#为什么我的监测数据表示调度未生效","children":[]},{"level":2,"title":"为什么我的监测数据相对于其他人来说不够优秀","slug":"为什么我的监测数据相对于其他人来说不够优秀","link":"#为什么我的监测数据相对于其他人来说不够优秀","children":[]},{"level":2,"title":"为什么部分 SoC 的游戏表现不太好","slug":"为什么部分-soc-的游戏表现不太好","link":"#为什么部分-soc-的游戏表现不太好","children":[]},{"level":2,"title":"Uperf & Apodidae 为何选择我们?","slug":"uperf-apodidae-为何选择我们","link":"#uperf-apodidae-为何选择我们","children":[]}],"relativePath":"guide.md"}'),o={name:"guide.md"},d=l('<h1 id="概述" tabindex="-1">概述 <a class="header-anchor" href="#概述" aria-hidden="true">#</a></h1><p>Apodidae 现已推出 V2.0.0 本手册提供的任何信息都有在未来的某个时刻更改的可能</p><h1 id="兼容性指南" tabindex="-1">兼容性指南 <a class="header-anchor" href="#兼容性指南" aria-hidden="true">#</a></h1><h2 id="cpu-controller" tabindex="-1">CPU Controller <a class="header-anchor" href="#cpu-controller" aria-hidden="true">#</a></h2><p>不兼容其他任何形式的 CPU 调控器，功能冲突<br> 清单：包括但不限于</p><ul><li>Scene 调度</li><li>Uperf</li></ul><h2 id="thread-scheduler" tabindex="-1">Thread Scheduler <a class="header-anchor" href="#thread-scheduler" aria-hidden="true">#</a></h2><p>不兼容任何形式的线程优化/调度，功能冲突<br> 清单：包括但不限于</p><ul><li>A-SOUL</li></ul><h2 id="gpu-controller" tabindex="-1">GPU Controller <a class="header-anchor" href="#gpu-controller" aria-hidden="true">#</a></h2><p>不兼容任何形式的 GPU 控制器，功能冲突<br> 清单：包括但不限于</p><ul><li>Scene MTK 专属功能内的 GPU 相关选项</li><li>带有 GPU 调控功能的 Uperf</li><li>天玑 GPU 调速器</li></ul><h2 id="voltage-optimization" tabindex="-1">Voltage Optimization <a class="header-anchor" href="#voltage-optimization" aria-hidden="true">#</a></h2><p>兼容 CPU/GPU 的降压应用<br> 清单：包括但不限于</p><ul><li>自由电子 e 天玑降压</li><li>嘟嘟 ski ＆ 秋秋 CPUhvfs</li></ul><p><strong>降压带来的风险和问题与 Apodidae 没有任何间接或直接关系</strong></p><h1 id="怎么用" tabindex="-1">怎么用？ <a class="header-anchor" href="#怎么用" aria-hidden="true">#</a></h1><p>Apodidae 提供了两种使用方式：</p><ul><li>Magisk 模块</li><li>Cutoolbox 配置文件</li></ul><p><strong>两种使用方式只能选择一种，如果你非要一起用，打架别来找我</strong></p><p><strong>Magisk 模块切换模式需要在终端内使用<code>CuDaemon -R 【配置文件路径】【调度模式文件(cur_mode.txt)路径】【调度日志文件生成路径</code></strong><br><strong>如果你看不懂上面那句话里的任何一个词，请使用cutoolbox</strong></p><p><strong>Apodidae 基于 CuprumTurbo-Scheduler，但与 Cutoolbox 不同，Cutoolbox 基于 CuprumTurbo-Scheduler 实现并加入了一些扩展功能</strong><br><strong>Apodidae 基于 CuprumTurbo-Scheduler, 但目前并未在源代码上做出任何更改，所以 Apodidae 与 CuprumTurbo-Scheduler 互相兼容</strong></p><h2 id="判断是否生效" tabindex="-1">判断是否生效 <a class="header-anchor" href="#判断是否生效" aria-hidden="true">#</a></h2><p>导入与 SoC 型号匹配的配置文件后点击上方显示状态的部分即可重启调度<br><strong>除了本网站标注的测试机型，Apodidae 不保证其他同 SoC 机型的可用性</strong> 显示<code>调度正在运行中</code>即为生效</p><h2 id="为什么我的监测数据表示调度未生效" tabindex="-1">为什么我的监测数据表示调度未生效 <a class="header-anchor" href="#为什么我的监测数据表示调度未生效" aria-hidden="true">#</a></h2><p>按照兼容性指南排查所有不兼容的应用及其残留</p><h2 id="为什么我的监测数据相对于其他人来说不够优秀" tabindex="-1">为什么我的监测数据相对于其他人来说不够优秀 <a class="header-anchor" href="#为什么我的监测数据相对于其他人来说不够优秀" aria-hidden="true">#</a></h2><p>SoC 体质，系统版本等等一大堆东西都会影响监测数据</p><h2 id="为什么部分-soc-的游戏表现不太好" tabindex="-1">为什么部分 SoC 的游戏表现不太好 <a class="header-anchor" href="#为什么部分-soc-的游戏表现不太好" aria-hidden="true">#</a></h2><p>纳兰音韵不玩游戏,同样不会针对游戏调整</p><h2 id="uperf-apodidae-为何选择我们" tabindex="-1">Uperf &amp; Apodidae 为何选择我们? <a class="header-anchor" href="#uperf-apodidae-为何选择我们" aria-hidden="true">#</a></h2><p><img src="'+i+'" alt="image"></p>',32),t=[d];function n(h,c,p,s,u,g){return r(),a("div",null,t)}const b=e(o,[["render",n]]);export{f as __pageData,b as default};
